/*
On a 2D plane, we place n stones at some integer coordinate points. Each coordinate point may have at most one stone.

A stone can be removed if it shares either the same row or the same column as another stone that has not been removed.

Given an array stones of length n where stones[i] = [xi, yi] represents the location of the ith stone, return the largest possible number of stones that can be removed.

 

Example 1:

Input: stones = [[0,0],[0,1],[1,0],[1,2],[2,1],[2,2]]
Output: 5
Explanation: One way to remove 5 stones is as follows:
1. Remove stone [2,2] because it shares the same row as [2,1].
2. Remove stone [2,1] because it shares the same column as [0,1].
3. Remove stone [1,2] because it shares the same row as [1,0].
4. Remove stone [1,0] because it shares the same column as [0,0].
5. Remove stone [0,1] because it shares the same row as [0,0].
Stone [0,0] cannot be removed since it does not share a row/column with another stone still on the plane.
Example 2:

Input: stones = [[0,0],[0,2],[1,1],[2,0],[2,2]]
Output: 3
Explanation: One way to make 3 moves is as follows:
1. Remove stone [2,2] because it shares the same row as [2,0].
2. Remove stone [2,0] because it shares the same column as [0,0].
3. Remove stone [0,2] because it shares the same row as [0,0].
Stones [0,0] and [1,1] cannot be removed since they do not share a row/column with another stone still on the plane.
Example 3:

Input: stones = [[0,0]]
Output: 0
Explanation: [0,0] is the only stone on the plane, so you cannot remove it.
*/

var removeStones = function(stones) {
  const rows = new Map();
  const cols = new Map();
  const groups = new Array(stones.length).fill(0).map((_, i) => i);
  const sizes = new Array(stones.length).fill(0);
  
  const find = (start) => {
    let current = start;
    while (groups[current] !== current) {
      current = groups[current];
    }
    return current;
  }
  
  const union = (groupA, groupB) => {
    const larger = sizes[groupA] > sizes[groupB] ? groupA : groupB;
    const smaller = larger === groupA ? groupB : groupA;
    
    sizes[larger] += sizes[smaller];
    groups[smaller] = larger;

    return larger;
  }
  
  for(let i = 0; i < stones.length; i += 1) {
    const [x, y] = stones[i];
    if (!rows.has(x)) rows.set(x, i);
    if (!cols.has(y)) cols.set(y, i);
    const group1 = find(rows.get(x));
    const group2 = find(cols.get(y));
    const group = group1 === group2 ? group1 : union(group1, group2);
    rows.set(x, group);
    cols.set(y, group);
    sizes[group] += 1;
  }
  
  return groups.reduce((total, group) => {
    const root = find(group, rows);
    total += Math.max(0, sizes[root] - 1);
    sizes[root] = 0;
    return total;
  }, 0)
};

const maxLen: number = 100;

for (let i = 0; i < 50; i += 1) {
  const len = numberBetween(2, maxLen);

  const gridLen = Math.floor(len / 2);
  const grid = new Array(gridLen).fill(0)
    .map(() => new Array(gridLen).fill(0))

  for(let j = 0; j < len; j += 1) {
    const x = numberBetween(0, gridLen - 1);
    const y = numberBetween(0, gridLen - 1);
    grid[y][x] = 1;
  }

  const stones = [];
  for(let r = 0; r < gridLen; r += 1) {
    for(let c = 0; c < gridLen; c += 1) {
      if(grid[r][c]) {
        stones.push([r, c]);
      }
    }
  }

  // logOutList('"' + words.trimEnd() + '"')
  // logOutList(printRow([houses, costs, len, numColors, target]) + ',')
  logOutList(printRow(stones));
  // logOutList(printRow([jobs, k]) + ',');
  // logOutLeetcode([s1, s2])
}

